import{_ as r,a,b as i,c as t}from"./chunks/FMU_Debug_Port_Horizontal.CZlcrhnb.js";import{_ as o,c as l,a8 as s,o as n}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"Holybro Pix32 v5","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/holybro_pix32_v5.md","filePath":"en/flight_controller/holybro_pix32_v5.md"}'),d={name:"en/flight_controller/holybro_pix32_v5.md"};function p(h,e,u,c,m,f){return n(),l("div",null,e[0]||(e[0]=[s('<h1 id="holybro-pix32-v5" tabindex="-1">Holybro Pix32 v5 <a class="header-anchor" href="#holybro-pix32-v5" aria-label="Permalink to &quot;Holybro Pix32 v5&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://holybro.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Pix32 v5</a><sup>®</sup> is an advanced autopilot flight controller designed and made by Holybro<sup>®</sup>. It is optimized to run on PX4 firmware, which is intended for both academic and commercial developers. It is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design and runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS. It can be regarded as a variant version of Pixhawk4.</p><p>The Pix32 v5 is designed for pilots who need a high power, flexible and customisable flight control system. It is comprised of a separate flight controller and carrier (base) board, which are connected by a 100pin connector. This design allows users to either select a base board made by Holybro, or customize their own.</p><p><img src="'+r+'" alt="Pix32 v5 Family"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="quick-summary" tabindex="-1">Quick Summary <a class="header-anchor" href="#quick-summary" aria-label="Permalink to &quot;Quick Summary&quot;">​</a></h2><ul><li>Main FMU Processor: STM32F765 <ul><li>32 Bit Arm® Cortex®-M7, 216MHz, 2MB memory, 512KB RAM</li></ul></li><li>IO Processor: STM32F100 <ul><li>32 Bit Arm® Cortex®-M3, 24MHz, 8KB SRAM</li></ul></li><li>On-board sensors: <ul><li>Accel/Gyro: ICM-20689</li><li>Accel/Gyro: BMI055 or ICM20602</li><li>Magnetometer: IST8310</li><li>Barometer: MS5611</li></ul></li><li>GPS: u-blox Neo-M8N GPS/GLONASS receiver; integrated magnetometer IST8310</li><li>Interfaces: <ul><li>8-16 PWM outputs (8 from IO, 8 from FMU)</li><li>3 dedicated PWM/Capture inputs on FMU</li><li>Dedicated R/C input for CPPM</li><li>Dedicated R/C input for Spektrum / DSM and S.Bus with analog / PWM RSSI input</li><li>Dedicated S.Bus servo output</li><li>5 general purpose serial ports <ul><li>2 with full flow control</li><li>1 with separate 1.5A current limit</li></ul></li><li>3 I2C ports</li><li>4 SPI buses <ul><li>1 internal high speed SPI sensor bus with 4 chip selects and 6 DRDYs</li><li>1 internal low noise SPI bus dedicated for</li><li>Barometer with 2 chip selects, no DRDYs</li><li>1 internal SPI bus dedicated for FRAM</li><li>Supports dedicated SPI calibration EEPROM located on sensor module</li><li>1 external SPI buses</li></ul></li><li>Up to 2 CANBuses for dual CAN with serial ESC <ul><li>Each CANBus has individual silent controls or ESC RX-MUX control</li><li>Analog inputs for voltage / current of 2 batteries</li><li>2 additional analog inputs</li></ul></li></ul></li><li>Electrical System: <ul><li>Power module output: 4.9~5.5V</li><li>Max input voltage: 6V</li><li>Max current sensing: 120A</li><li>USB Power Input: 4.75~5.25V</li><li>Servo Rail Input: 0~36V</li></ul></li><li>Weight and Dimensions: <ul><li>Dimensions: 45x45x13.5mm</li><li>Weight: 33.0g</li></ul></li><li>Environmental Data, Quality &amp; Reliability: <ul><li>Operating temperature: -40 ~ 85°c</li><li>Storage temp. -40~85℃</li><li>CE</li><li>FCC</li><li>RoHS compliant (lead-free)</li></ul></li></ul><p>Additional information can be found in the <a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 V5 Technical Data Sheet</a>.</p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Order from <a href="https://holybro.com/products/pix32-v5" target="_blank" rel="noreferrer">Holybro website</a>.</p><h2 id="assembly-setup" tabindex="-1">Assembly/Setup <a class="header-anchor" href="#assembly-setup" aria-label="Permalink to &quot;Assembly/Setup&quot;">​</a></h2><p>The <a href="./../assembly/quick_start_holybro_pix32_v5.html">Pix32 v5 Wiring Quick Start</a> provides instructions on how to assemble required/important peripherals including GPS, Power Management Board etc.</p><h2 id="base-board-layouts" tabindex="-1">Base Board Layouts <a class="header-anchor" href="#base-board-layouts" aria-label="Permalink to &quot;Base Board Layouts&quot;">​</a></h2><p><img src="'+a+'" alt="Pix32 v5 Image"></p><h2 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h2><p><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer"><em>pix32 v5</em> and mini baseboard</a></p><h2 id="dimensions" tabindex="-1">Dimensions <a class="header-anchor" href="#dimensions" aria-label="Permalink to &quot;Dimensions&quot;">​</a></h2><p><img src="'+i+'" alt="Pix32 v5 Image"></p><h2 id="voltage-ratings" tabindex="-1">Voltage Ratings <a class="header-anchor" href="#voltage-ratings" aria-label="Permalink to &quot;Voltage Ratings&quot;">​</a></h2><p><em>Pix32 v5</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWER1</strong>, <strong>POWER2</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.9V to 5.5V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><p><strong>Absolute Maximum Ratings</strong></p><p>Under these conditions the system will not draw any power (will not be operational), but will remain intact.</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (operational range 4.1V to 5.7V, 0V to 10V undamaged)</li><li><strong>USB</strong> input (operational range 4.1V to 5.7V, 0V to 6V undamaged)</li><li>Servo input: VDD_SERVO pin of <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 42V undamaged)</li></ol><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make holybro_pix32v5_default</span></span></code></pre></div><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><p>The system&#39;s <a href="./../debug/system_console.html">serial console</a> and SWD interface runs on the <strong>FMU Debug</strong> port</p><p><img src="'+t+'" alt="FMU debug port diagram"></p><p>The pinout uses the standard <a href="./../debug/swd_debug.html#pixhawk-debug-mini">Pixhawk Debug Mini</a> interface defined in the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a>.</p><h2 id="peripherals" tabindex="-1">Peripherals <a class="header-anchor" href="#peripherals" aria-label="Permalink to &quot;Peripherals&quot;">​</a></h2><ul><li><a href="./../sensor/airspeed.html">Digital Airspeed Sensor</a></li><li><a href="./../telemetry/">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="additional-information" tabindex="-1">Additional Information <a class="header-anchor" href="#additional-information" aria-label="Permalink to &quot;Additional Information&quot;">​</a></h2><ul><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5_technical_data_sheet_v1.1.pdf" target="_blank" rel="noreferrer">Pix32 v5 Technical Data Sheet</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_Pix32-V5-Base-Mini-Pinouts.pdf" target="_blank" rel="noreferrer">Pix32 v5 Pinouts</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-BASE-Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Base Board Schematic Diagram</a></li><li><a href="https://cdn.shopify.com/s/files/1/0604/5905/7341/files/Holybro_PIX32-V5-Base-Mini-Board_Schematic_diagram.pdf" target="_blank" rel="noreferrer">Pix32 v5 Mini Base Board Schematic Diagram</a></li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a>.</li></ul>',42)]))}const _=o(d,[["render",p]]);export{P as __pageData,_ as default};
